	function f_vpn ($1, $2)
	{
	
	clear-host
	Start-Process -FilePath ".\stunnel\stunnel.exe" -argumentlist ".\config\$1" -verb runAs
	Start-Process -FilePath ".\OpenVPN\OpenVPNPortable.exe" -argumentlist "--connect $2" -verb runAs
	}
	
	function f_ip ($Serveurf)
	{
	$test = (Test-Connection -ComputerName $Serveurf -Count 1  | measure-Object -Property ResponseTime -Average).average
	$response = ($test -as [int] )
	return $response
	}
	
	foreach ($Server in $serveurs)
	{
	[int[]]$t_ms+= f_ip $Server.Server
	}
	
	[int]$i=$t_ms | Measure-Object -minimum | Select-Object -ExpandProperty Minimum
	[int]$i2= $t_ms.IndexOf($i)
	
	$Serveurs2= Import-Csv $srvlist | Where-Object { $_.Id -eq $i2}
	f_vpn $Serveurs2.Stunnel $Serveurs2.OpenVpn
	}
		
